// StackACLSum represents sum type.
type StackACLSum struct {
	Type StackACLSumType // switch on this field
	ACL  ACL
}

// StackACLSumType is oneOf type of StackACLSum.
type StackACLSumType string

// Possible values for StackACLSumType.
const (
	ACLStackACLSum StackACLSumType = "ACL"
)

// IsACL reports whether StackACLSum is ACL.
func (s StackACLSum) IsACL() bool { return s.Type == ACLStackACLSum }

// SetACL sets StackACLSum to ACL.
func (s *StackACLSum) SetACL(v ACL) {
	s.Type = ACLStackACLSum
	s.ACL = v
}

// GetACL returns ACL and true boolean if StackACLSum is ACL.
func (s StackACLSum) GetACL() (v ACL, ok bool) {
	if !s.IsACL() {
		return v, false
	}
	return s.ACL, true
}

// NewACLStackACLSum returns new StackACLSum from ACL.
func NewACLStackACLSum(v ACL) StackACLSum {
	var s StackACLSum
	s.SetACL(v)
	return s
}

